SELECT COUNT(DISTINCT t.transaction_id) AS transaction_count
FROM banking_new."Transactions" t
JOIN banking_new."Loans" l ON t.account_id = l.customer_id;

SELECT COUNT(DISTINCT t.transaction_id) AS total_transactions
FROM banking_new."Transactions" t
JOIN banking_new."Cards" c ON t.account_id = c.customer_id;

SELECT customer_id, COUNT(*) AS average_accounts_per_customer
FROM banking_new."Accounts"
GROUP BY customer_id;

SELECT customer_id, COUNT(*) AS average_loans_per_customer
FROM banking_new."Loans"
GROUP BY customer_id;

SELECT customer_id, COUNT(deposit_id) AS average_deposits_per_customer
FROM banking_new."Deposits"
GROUP BY customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS total_unique_customers
FROM banking_new."Customers"
JOIN banking_new."Accounts" ON "Customers".customer_id = "Accounts".customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS total_unique_customers_with_deposits
FROM banking_new."Customers"
JOIN banking_new."Deposits" ON "Customers".customer_id = "Deposits".customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS total_unique_customers_with_loans
FROM banking_new."Customers"
JOIN banking_new."Loans" ON "Customers".customer_id = "Loans".customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS total_unique_customers_with_cards
FROM banking_new."Customers"
JOIN banking_new."Cards" ON "Customers".customer_id = "Cards".customer_id;

SELECT COUNT(*) AS transaction_count
